import React from 'react';
import { FaApple } from "react-icons/fa";
import wallpaper from "../assets/macWallpaper.jpg";

function Mac() {
  const date = new Date();
  const formattedDate = date.toDateString().split(" ");
  return (
    <div className="w-screen h-screen">
      <div id="MenuBar" className='h-7 w-screen bg-black text-white flex'>
        <div id="MenuBar-L" className='w-1/2 h-full flex items-center space-x-5 pl-4 '>
          <FaApple color='white' />
          <p>Derricks Portfolio</p>
        </div>
        <div id="MenuBar-R" className='w-1/2 h-full flex items-center pr-2 flex-row-reverse'>
          <p className='px-3'>1:28 PM</p>
          <p className='px-3'>{formattedDate[0]}</p>
        </div>
      </div>
      <img className="mt-5 scale-105 -z-10" src={wallpaper}></img>
    </div>
  );
}

export default Mac;
